import React from 'react';
import { Link} from "react-router-dom";

class Nav extends React.Component {
    render() {
        return (
            <div>
 
                <div class="containers" onclick="toggleSidebar()" style={{ marginRight: "10px", marginLeft: "20px" }}>
                    <br />
                    <ul class="sidenav">

                <li><a class="glyphicon glyphicon-home" /><Link to="/dashboard">Dashboard</Link></li>
                <li><a class="glyphicon glyphicon-user"><Link to="/createrole">Create-Role</Link></a></li>
               <li><a class="glyphicon glyphicon-list"><Link to="/manageusers">Manage-Users</Link></a></li>
               <li><a class="glyphicon glyphicon-list-alt"><Link to="/reconcile">Reconcile</Link></a></li>
               <li><a class="glyphicon glyphicon-briefcase"><Link to="/upload">Upload</Link></a></li>
               <li><a class="glyphicon glyphicon-tasks"><Link to="/usermanagement">UserManagement</Link></a></li>
               <li><a class="glyphicon glyphicon-transfer"><Link to="/warehousemanagement">WareHouseManagement</Link></a></li>
                    </ul>
                </div>
            </div>

        );
    }
}

export default Nav;
